// ----- 8< ----- FILE "./trap.v" ----- 8< -----

import "DPI-C" context function void check_ebreak(input bit flag);

module Trap(
    input wire      clock,
    input wire      reset,
    input wire      isEbreak
);

  always @(isEbreak) begin
      check_ebreak(isEbreak);
  end

endmodule

// ----- 8< ----- FILE "./getPC.v" ----- 8< -----

import "DPI-C" context function void get_pc(input int flag);

module GetPC(
    input wire        clock,
    input wire        reset,
    input wire [31:0] pc
);

  always @(*) begin
      get_pc(pc);
  end

endmodule

// ----- 8< ----- FILE "./dataSRAM.v" ----- 8< -----

import "DPI-C" context function int paddr_read(input int addr, input int len);
import "DPI-C" context function void paddr_write(input int addr, input int len, input int data);

module DataSRAM(
  input  wire        clock,
  input  wire        reset,
  input  wire        isLoad,
  input  wire        isStore,
  input  wire [31:0] addr,
  input  wire [31:0] len,
  input  wire [31:0] wdata,
  output reg  [31:0] res
);

  reg load_flag ;
  reg store_flag ;

  always @(addr) begin
    load_flag = isLoad;
    store_flag = isStore;
    if (load_flag) begin
      res = paddr_read(addr, len);
      load_flag = 0;
    end
    else begin
      res = addr;
    end
    if (store_flag) begin
      paddr_write(addr, len, wdata);
      store_flag = 0;
    end
  end

endmodule

// ----- 8< ----- FILE "./instSRAM.v" ----- 8< -----

module InstSRAM(
  input  wire        clock,
  input  wire        reset,
  input  wire [31:0] pc,
  output reg  [31:0] inst
);

  always @(pc) begin
    if(pc != 0) begin
      inst = paddr_read(pc, 4);
    end
  end

endmodule

